import React, { Component } from 'react';
import axios from 'axios';

class Table extends Component {
  constructor(props){
     super(props);
     this.state = {
      tableData: [],
    }
  }

  componentDidMount() {
    this.fetchDataTable();
  }

  fetchDataTable = async () => {
    const response = await fetch('http://localhost:5000/users', {mode: "cors"})
    console.log(response)
    return response.json();
  };

  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Nama</th>
            <th>Pekerjaan</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Andi</td>
            <td>Dokter</td>
          </tr>
          <tr>
            <td>Bela</td>
            <td>Wiraswasta</td>
          </tr>
          <tr>
            <td>Clara</td>
            <td>Karyawan Bank</td>
          </tr>
        </tbody>
      </table>
    )
  }
}

export default Table
